<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta
      name="viewport"
      content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0"
    />
    <title>Gamining</title>
    <style>
      @charset "UTF-8";
      article,
      aside,
      details,
      figcaption,
      figure,
      footer,
      header,
      hgroup,
      menu,
      nav,
      section {
        display: block;
      }
      html,
      body,
      div,
      span,
      applet,
      object,
      iframe,
      h1,
      h2,
      h3,
      h4,
      h5,
      h6,
      p,
      blockquote,
      pre,
      a,
      abbr,
      acronym,
      address,
      big,
      cite,
      code,
      del,
      dfn,
      em,
      img,
      ins,
      kbd,
      q,
      s,
      samp,
      small,
      strike,
      strong,
      sub,
      sup,
      tt,
      var,
      b,
      u,
      i,
      center,
      dl,
      dt,
      dd,
      ol,
      ul,
      li,
      fieldset,
      form,
      label,
      legend,
      table,
      caption,
      tbody,
      tfoot,
      thead,
      tr,
      th,
      td,
      article,
      aside,
      canvas,
      details,
      embed,
      figure,
      figcaption,
      footer,
      header,
      hgroup,
      menu,
      nav,
      output,
      ruby,
      section,
      summary,
      time,
      mark,
      audio,
      video,
      button {
        margin: 0;
        padding: 0;
        border: 0;
        font-size: 100%;
        font: inherit;
        vertical-align: baseline;
        box-sizing: border-box;
        color: #fff;
        font-family: Montserrat;
      }
      img,
      svg {
        transition: 0.3s;
      }
      a:hover,
      button:hover {
        cursor: pointer;
        opacity: 0.7;
      }
      .dnone {
        display: none;
      }
      a {
        text-decoration: none;
      }
      input {
        box-sizing: border-box;
      }
      .free_img {
        position: relative;
        height: 0px;
        width: 0px;
        display: flex;
        justify-content: center;
        align-items: center;
      }
      body,
      html {
        overflow: hidden;
      }
      .app {
        display: flex;
        justify-content: center;
        align-items: center;
        width: 100dvw;
        height: 100dvh;
        position: absolute;
      }
      .content_wrapper {
        display: flex;
        justify-content: center;
        align-items: center;
        width: 100dvw;
      }
      .free_img {
        width: 0;
        height: 0;
        display: flex;
        justify-content: center;
        align-items: center;
        position: relative;
      }
      .bg {
        position: absolute;
        top: 0;
        left: 0;
      }
      .bg img {
        width: 100dvw;
        height: 100dvh;
      }
      .bg .bgHor {
        display: none;
      }
      .bg .bgVert {
        display: block;
      }
      .fone {
        overflow: hidden;
      }
      .fone img {
        position: absolute;
        z-index: 1;
      }
      .content {
        display: flex;
        justify-content: center;
        align-items: center;
        align-content: center;
        flex-wrap: wrap;
        height: 100dvh;
        width: 100dvw;
      }
      .content .nft {
        z-index: 2;
      }
      .content .nft img {
        transition: transform 0.5s;
      }
      .content .nft img.hide {
        transform: scale(0) rotate(-820deg);
      }
      .content .text {
        overflow: hidden;
        z-index: 2;
      }
      .content .text img {
        transition: transform 0.5s;
        position: absolute;
      }
      .content .text img.hide {
        transform: translate(0);
      }
      .content .btn {
        z-index: 2;
      }
      .content .btn img {
        transition: opacity 0.5s;
      }
      .content .btn img.hide {
        opacity: 0;
      }
      @media (min-aspect-ratio: 1/1) {
        .fone .decorCoin1 {
          height: 15dvh;
          bottom: 5dvh;
          left: 44dvw;
        }
        .fone .decorCoin2 {
          height: 20dvh;
          right: 0;
        }
        .spinner {
          display: none;
        }
        .content__spinner-hor {
          width: 48dvw;
          height: 100dvh;
          display: flex;
          justify-content: center;
          align-items: center;
        }
        .content__spinner-hor #speenStormHor {
          width: auto;
          height: 90dvh;
        }
        .content__spinner-hor #speenBgHor {
          width: auto;
          height: 80.5dvh;
        }
        .content__spinner-hor #spennerHor {
          width: auto;
          height: 45dvh;
        }
        .content__spinner-hor #speenDecorHor {
          width: auto;
          height: 54.4dvh;
        }
        .content {
          width: 48dvw;
        }
        .bg .bgVert {
          display: none;
        }
        .bg .bgHor {
          display: block;
        }
        .logo {
          height: 12dvh;
        }
        .logo #logo {
          width: auto;
          height: 7dvh;
        }
        .text {
          height: 10vh;
        }
        .text img {
          width: auto;
          height: 9dvh;
        }
        .nft {
          height: 50dvh;
        }
        .nft img {
          width: auto;
          height: 50dvh;
        }
        .nft img.big {
          height: 74dvh;
        }
        .btn {
          height: 13dvh;
        }
        .btn img {
          width: auto;
          height: 11dvh;
        }
        .btn img.big {
          height: 24dvh;
        }
      }
      @media (max-aspect-ratio: 1/1) {
        .fone .decorCoin1 {
          height: 15dvh;
          bottom: 7dvh;
          left: 5dvw;
        }
        .fone .decorCoin2 {
          height: 17dvh;
          right: 0;
          bottom: 22dvh;
        }
        .content__spinner-hor {
          display: none;
        }
        .logo {
          height: 5dvh;
        }
        .logo #logo {
          width: auto;
          height: 5dvh;
        }
        .spinner {
          display: flex;
          height: 48dvh;
        }
        .spinner #speenStormVert {
          width: auto;
          height: 55dvh;
        }
        .spinner #spennerVert {
          width: auto;
          height: 28dvh;
        }
        .spinner #speenBgVert {
          width: auto;
          height: 50.5dvh;
        }
        .spinner #speenDecorVert {
          width: auto;
          height: 34.5dvh;
        }
        .text {
          height: 6vh;
        }
        .text img {
          width: auto;
          height: 6dvh;
        }
        .nft {
          height: 28dvh;
        }
        .nft img {
          width: auto;
          height: 25dvh;
        }
        .nft img.big {
          width: auto;
          height: 39dvh;
        }
        .btn {
          height: 7dvh;
        }
        .btn img {
          width: auto;
          height: 7dvh;
        }
        .btn img.big {
          width: auto;
          height: 14dvh;
        }
      }
      .blink {
        animation: blink 1s ease-in-out infinite alternate forwards;
      }
      @keyframes blink {
        0% {
          transform: scale(1);
        }
        to {
          transform: scale(1.1);
        }
      }
      .levitation {
        animation: levitation 4s ease-in-out infinite alternate forwards;
      }
      .levitation2 {
        animation: levitation2 5s ease-in-out infinite alternate forwards;
      }
      @keyframes levitation {
        0% {
          transform: scale(1) translate(0) rotate(0);
        }
        to {
          transform: scale(0.9) translate(-20%, -120%) rotate(-50deg);
        }
      }
      @keyframes levitation2 {
        0% {
          transform: scale(1) translate(0) rotate(0);
        }
        to {
          transform: scale(0.9) translate(30%, 80%) rotate(150deg);
        }
      }
    </style>
  </head>
